    [],nt"revision_timestamp": "2015-06-17T01:57:14.167635",nt"name": "brown-bear-telemetry-and-trapping-special-report",nt"isopen":
    false,nt"url": null,nt"notes": "Brown bear studies were continued during
    the 1967 field season with emphasis on development of techniques for instrumenting
    bears with radio transmitters and monitoring movements of instrumented animals.
    Information obtained was applicable to long range objectives of learning more of
    the life history of brown bear so that this information could be applied to improved
    management principles. This report is an account of the procedures used, the results
    obtained in 1967, and recommendations for future research and application to management.",nt"license_title":
